full_text:
@RemiFeraud @bayrou Monsieur @RemiFeraud,

Le vote de chaque Parisien doit pouvoir compter autant que celui d’un électeur d’une autre ville de France.

Lorsqu’on se soucie réellement des Parisiens et de la démocratie, vouloir cette régularisation au plus vite n’a rien d’un « scandale démocratique ».

@monopolyon7 @gare_ta @lyonmag @bayrou Je ne pense pas que ce soit de la "détestation" mais plutôt un rejet raisonnable de son manque:

- de compétence démontré pour ce poste (idem ses adjoints)

- profond de compréhension de la ville, ses habitants et leurs aspirations profondes sur le tps long -&gt; le maire ChatGPT.
